package cn.teamwang.algorithm.daily.leetcode;

import java.util.LinkedList;
import java.util.Queue;

/**
 * 392. 判断子序列
 *
 * @author <a href="mailto:clorisforcoding@gmail.com">Jacky Fang</a>
 */
public class IsSubsequence {
    // todo 再增加判断连续子序列的题目
    // todo 优化代码，使用双指针/dp
    public static void main(String[] args) {
        String s1 = "abc";
        String t1 = "ahbgdc";
        String s2 = "axc";
        String t2 = "ahbgdc";
        String s3 = "leeeeetcode";
        String t3 = "";
//        System.out.println(isSubsequence(s1, t1));
//        System.out.println(isSubsequence(s2, t2));
        System.out.println(isSubsequence(s3, t3));
    }

    public static boolean isSubsequence(String s, String t) {
        Queue<Character> queue = new LinkedList<>();

        for (char c : s.toCharArray()) {
            queue.offer(c);
        }
        for (char c : t.toCharArray()) {
            if (!queue.isEmpty() && queue.peek() == c) {
                queue.poll();
            }
        }
        return queue.isEmpty();
    }
}
